@mjwhansen @louisnicholls_ @MrSimonBennett The approach we took was inspired by what @amyhoy @alexhillman and @brennandunn do with their products.

Our execution was never as slick as theirs.

But, IIRC, the boost to growth from doing two or three was like adding more than a month of normal growth each year.

