@__au6ust__ @patio11 This is very encouraging to hear. Thank you for sharing!

Can you share any of the messaging you sent to customers? Was it a single email?

I'm also interested to know what the absolute cost of the price rise was for most customers.

@bernardmbaruch_ Excellent points!

I'd not appreciated that as almost a benefit of having a high-churn product.

I agree about the dormant value but worry so much of it is in the form of trust. Price rises on existing customers chip away at that trust. That could mean fewer referrals.

@nathanbarry @patio11 Thank you for sharing this!

I'm surprised. ConvertKit never struck me as a product that needed to compete on price. I can't think of a better tool for doing what you do.

I guess I'm not a typical customer. :)

@patio11 Raising prices on new customers has worked well for businesses I've worked with.

I hadn't considered the pull-off-the-bandaid way for existing customers. Makes sense. Any increase is painful.

Your comment seems to have turned this poll around :)

@alexhillman Absolutely.

I should add something about that to the caution I include at the end of each @EmpathyDeployed episode.

I have a feeling there are elements of 30x500 that I unconsciously apply to help me with this.

@onejasonknight They are.

But I am pleased to see number followers don’t seem to have as much of an impact as they once did.

New accounts I follow with few followers and only ocassional tweets often break through the noise.

@sbartholomew Thank you! That’s great to hear. :)

Good point. Lots of ideas coming out of the interviews. And I can probably recycle quite a bit of what I shared yesterday too.

I need to get into the habit of posting one small thing every day.

